import io
import os
import base64

def make_module(name, desc, version):
    path = os.getcwd()
    os.mkdir(f"{path}/{name}")
    os.mkdir(f"{path}/{name}/views")
    os.mkdir(f"{path}/{name}/models")
    os.mkdir(f"{path}/{name}/static")
    os.mkdir(f"{path}/{name}/static/description")

    open(f"{path}/{name}/__init__.py", "w").close()
    open(f"{path}/{name}/README.md", "w").close()
    open(f"{path}/{name}/models/__init__.py", "w").close()
    manifest_content = """
# Â© 2024 CONINPE Consultores Informaticos
# Licence AGPL-3.0 or later (http://gnu.org/license/agpl.html).
{
    "name": "%s",
    "summary": "%s",
    "version": "%s.1.0.0",
    "author": "Coninpe",
    "license": "AGPL-3",
    "website": "https://coninpe.es/",
    "category": "",
    "depends": [
    ],
    "data": [
    
    ],
    "installable": True,
}
""" % (name, desc, version)
    manifest_file = open(f"{path}/{name}/__manifest__.py", "w")
    manifest_file.write(manifest_content)
    manifest_file.close()
    image_b64 = """
    """
    image_bytes = base64.b64decode(image_b64)
    image = io.BytesIO(image_bytes)
    with open(f"{path}/{name}/static/description/icon.png", "wb") as f:
        f.write(image.read())